import Vue from 'vue'
import VueRouter from 'vue-router'
import Global from '../views/Global.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'Global',
    component: Global
  },
  {
    path: '/afr',
    name: 'AFR',
    component: Global
  },
  {
    path: '/sfr',
    name: 'SFR',
    component: Global
  },
  {
    path: '/clc',
    name: 'CLC',
    component: Global
  },
  {
    path: '/trng',
    name: 'Global',
    component: Global
  },
  {
    path: '/TRNG',
    name: 'Global',
    component: Global
  },
  {
    path: '/TRNG',
    name: 'Global',
    component: Global
  },
  {
    path: '/about',
    name: 'about',
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    //component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = new VueRouter({
  routes
})

export default router
